import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@material-ui/icons/Sort'
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';

function Header() {

    const useStyles = makeStyles((theme) => ({
        appbar: {
            background: 'none',
            textAlign: 'left',
            background: 'rgba(0,0,0,0.08)',
        },
        root: {
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            color: '#fff',
            fontFamily: 'Nunito',
            // textAlign: 'center',
        },
        button: {
            color:'#fff',
            backgroundColor: '#FCC4D6',
            fontSize: '1.5rem',
            margin: '1.5px',
            borderRadius: 5,
            borderColor: 'rgba(0,0,0,0.08)',
        },
        appbarWrapper:{
            width: '80%',
            margin: 'auto',
        },
        appbarTitle: {
            flexGrow: '2',
        },
        colorText: {
            color:'#FCC4D6',
        },
        title: {
            fontSize: '3rem'
        },
        down: {
            color:'#FCC4D6',
            fontSize: '2rem',
        },
    }));
    const classes = useStyles()

    return (
        <div className={classes.root}>
            <AppBar className={classes.appbar} elevation={0} >
                <Toolbar className={classes.appbarWrapper} >
                <h1 className={classes.appbarTitle}>Jay's<span className={classes.colorText}>List</span></h1>
                <IconButton >
                <SortIcon className={classes.icon} />
                </IconButton>
                </Toolbar>
            </AppBar>
            <div className={classes.container}>
            <h1 className={classes.title}>Welcome to <br/> Jay's<span className={classes.colorText}>List</span></h1>
            <button type="button" className={classes.button}>View Products</button>
            <button type="button" class={classes.button}>Log in</button>


            </div>
        </div>
    );
}

export default Header;
